eval("module.exports = [{\"fileName\":\"introduction.md\",\"id\":\"introduction\",\"route\":\"/\",\"sections\":[{\"raw\":\"# Themeable\",\"level\":1,\"name\":\"Themeable\",\"breadcrumbs\":[\"Themeable\"],\"content\":\", statically extracted CSS&#8209;in&#8209;JS with near&#8209;zero runtime.  Write your styles in JavaScript/TypeScript within treat files** (e.g. Button.treat.js) that get executed at build time.  All CSS rules are created ahead of time, so the runtime is very_ lightweight—only needing to swap out pre-existing classes. In fact, if your application doesn't use theming, you don't even need the runtime at all.  All CSS logic, including its dependencies, will not be included in your final bundle.  Because theming is achieved by generating multiple classes, **_legacy browsers are supported.\",\"page\":\"Introduction\",\"hash\":\"themeable\"},{\"raw\":\"## Requirements\",\"level\":2,\"name\":\"Requirements\",\"breadcrumbs\":[\"Themeable\",\"Requirements\"],\"content\":\"  Your project must be using webpack with the supplied webpack plugin, but that's it.  First-class support is provided for React and TypeScript, but those layers are entirely optional. The core runtime API can be integrated into other frameworks, if needed.  The runtime makes use of Map, so you may need a polyfill for pre-ES2015 browsers.\",\"page\":\"Introduction\",\"hash\":\"requirements\"},{\"raw\":\"## Basic usage\",\"level\":2,\"name\":\"Basic usage\",\"breadcrumbs\":[\"Themeable\",\"Basic usage\"],\"content\":\"  First, install the core library.\",\"page\":\"Introduction\",\"hash\":\"basic-usage\"},{\"raw\":\"## Themed usage\",\"level\":2,\"name\":\"Themed usage\",\"breadcrumbs\":[\"Themeable\",\"Themed usage\"],\"content\":\"This themed usage example makes use of react-treat to keep things simple. React is not required to use treat.  First, install react-treat.\",\"page\":\"Introduction\",\"hash\":\"themed-usage\"}]},{\"fileName\":\"background.md\",\"id\":\"background\",\"route\":\"/background\",\"sections\":[{\"raw\":\"# Background\",\"level\":1,\"name\":\"Background\",\"breadcrumbs\":[\"Background\"],\"content\":\"\",\"page\":\"Background\",\"hash\":\"background\"},{\"raw\":\"## Tradeoffs\",\"level\":2,\"name\":\"Tradeoffs\",\"breadcrumbs\":[\"Background\",\"Tradeoffs\"],\"content\":\"  There are plenty of great CSS-in-JS solutions available—and we're big fans of them. However, treat has taken quite a different approach.  The primary goals of treat are full static extraction, minimal runtime code, type safety and legacy browser support. While a great developer experience is important to us, it will never come at the cost of these goals.  Unlike a lot of CSS-in-JS approaches, treat is much more similar to CSS Modules, requiring a bit more work to bind styles to your components. It's also unable to generate styles at runtime, which means it cannot handle dynamic theming. The upside of treat is that it allows you to craft themeable, statically extracted CSS using JavaScript (or TypeScript) with little impact to bundle size and negligible runtime performance cost.  If you're used to libraries like styled-components or Emotion, treat might seem like a step backwards. These libraries can quickly and easily create dynamic component-oriented styles. However, they come with a bundle size and performance cost. For plenty of applications, this is a worthwhile tradeoff—and these libraries are a great choice if this isn't an issue for you.  If you're familiar with static CSS-in-JS libraries like Linaria and Astroturf, treat is very similar but with a couple of notable differences. Firstly, treat's theming mechanism doesn't require CSS custom property support (i.e. CSS variables), which means that legacy browsers like IE11 are supported. Secondly, styles are written as objects rather than template literals, to both ensure type safety, and to encourage you to think of your styles as data rather than strings of CSS.\",\"page\":\"Background\",\"hash\":\"tradeoffs\"},{\"raw\":\"## Backstory\",\"level\":2,\"name\":\"Backstory\",\"breadcrumbs\":[\"Background\",\"Backstory\"],\"content\":\"You don't have to read this to understand treat, but it'll give you a much better understanding of where we're coming from.  The origins of treat begin with Braid, our design system.  Braid was originally built with CSS Modules, but authored in JavaScript (via css-in-js-loader). Unfortunately, we were hitting up against the limits of this approach.  Problem #1: We were unable to author our CSS Modules in TypeScript.  When you attempt to write your CSS Modules in TypeScript, you export an entire style sheet object (which then gets converted to a CSS Module by postcss-js).  For example, let's assume we have the following style sheet:    The TypeScript compiler can't make sense of this without an understanding of the transformation happening within webpack. When looking at the raw source code, this doesn't make sense from a type perspective.  As a result, even though the rest of our project was now written in TypeScript, we were forced to keep our CSS written in JavaScript. As a workaround, we generated TypeScript declaration files (via our own css-modules-typescript-loader), but it was less than ideal.  Problem #2: CSS Modules only provided a single flat namespace to work with.  We were generating themed collections of utility classes and wanted to export multiple namespaces from a single file, e.g. paddingTop, background, color, etc.  We were forced to manually namespace properties with underscores, which required a lot of boilerplate code to convert these into nested data structures (e.g. converting paddingTop_large into paddingTop.large).  TypeScript made this particularly painful because we also had to maintain type definitions for these extra translation steps.  Potential solution: Runtime CSS-in-JS?  At this point we talked about migrating to a runtime CSS-in-JS library like styled-components or Emotion. In fact, if we were starting from scratch, it's likely we would have simply reached for one of these libraries. That certainly would have solved our immediate problems.  However, we weren't starting from scratch. Instead, we were beginning to roll out our new design system to an existing, well-established ecosystem that had grown accustomed to the technical tradeoffs and runtime characteristics of CSS Modules.  Some of our projects are particularly sensitive to changes in bundle size and runtime performance, and we didn't want to negatively impact these projects from the outside. Some of our projects are even shipped as standalone JavaScript widgets into external codebases. We wanted to be sure that our new design system wouldn't come with a noticeable change in footprint.  We did leave the door open to adopting this architecture in the future, but decided that we wanted to see how far we could go with our current set of tradeoffs.  Potential solution: Static CSS-in-JS?  The next step for us was to investigate libraries like Linaria and Astroturf, which are both really interesting attempts at getting the best of both worlds—CSS-in-JS without the runtime overhead.  Unfortunately, neither of them quite fit our particular needs.  Astroturf is a really lean solution to this problem, essentially supporting CSS Modules and standard preprocessors within JavaScript template literals. That makes it much more ergonomic than more traditional approaches, but it also inherits all of the limitations we were experiencing with CSS Modules.  Linaria looked a lot more promising due to its theming support, but it came with an important caveat. Theming is achieved via CSS custom properties (i.e. CSS variables), which means that legacy browsers like IE11 are not supported. This simply wasn't an option for us.  Potential solution: Something new?  As a result, we started talking about alternative ideas. Something that could offer the theming ability of Linaria, but without the reliance on CSS variables. Something that could offer the runtime characteristics of CSS Modules, while feeling like regular JavaScript (or, in our case, TypeScript).  That's when the early ideas for treat started to emerge.  Early API designs looked promising, and initial prototypes proved that the concept could be supported by webpack. We decided to start investing in this approach—slowly at first, but ramping up as it started to further prove itself.  We continued to refine treat over several months while we simultaneously worked on Braid, with the development of one supporting the other. The code in Braid was now much more maintainable than it was before, and treat ultimately shipped to production, supporting real applications, with only a couple of minor hiccups along the way.  After using treat internally for a considerable amount of time, we decided we were finally ready to share treat with the world—and here you are! 😎\",\"page\":\"Background\",\"hash\":\"backstory\"},{\"raw\":\"## Thanks\",\"level\":2,\"name\":\"Thanks\",\"breadcrumbs\":[\"Background\",\"Thanks\"],\"content\":\"  Johannes Ewald for letting us have the treat name on npm.  Nathan Nam Tran for creating css-in-js-loader, which served as the initial starting point for our approach.  SEEK for giving us the space to do interesting work.\",\"page\":\"Background\",\"hash\":\"thanks\"}]},{\"fileName\":\"how-it-works.md\",\"id\":\"how-it-works\",\"route\":\"/how-it-works\",\"sections\":[{\"raw\":\"# How it works\",\"level\":1,\"name\":\"How it works\",\"breadcrumbs\":[\"How it works\"],\"content\":\"\",\"page\":\"How it works\",\"hash\":\"how-it-works\"},{\"raw\":\"## Static extraction\",\"level\":2,\"name\":\"Static extraction\",\"breadcrumbs\":[\"How it works\",\"Static extraction\"],\"content\":\"  In order to support static extraction of CSS from JavaScript code, styles are authored in JavaScript files with a special extension (.treat.js / .treat.ts by default). We refer to these files as treat files.  These treat files are separated from regular JavaScript files so that they can be compiled and executed at build time rather than being executed in the browser.  Conceptually, this is no different to preprocessors like Sass and Less. The difference is that, rather than using a custom domain-specific language, treat lets you use JavaScript as your preprocessor.  Within treat files, treat provides a set of styling APIs for generating CSS. Calling these APIs will result in styles being added to your application bundle. In order to expose these styles to your application code, they must be explicitly exported:    Generated styles are separately passed through the webpack loader pipeline, which allows you to create static CSS files via mini-css-extract-plugin.  For more details, see our webpack setup guide.\",\"page\":\"How it works\",\"hash\":\"static-extraction\"},{\"raw\":\"## Theming\",\"level\":2,\"name\":\"Theming\",\"breadcrumbs\":[\"How it works\",\"Theming\"],\"content\":\"  For themed styles, treat generates a separate block of CSS for each theme.  For example, let's assume you have the following themes defined:    Note that the style order has changed, with the non-themed styles rising to the top of the file, which means that the inactive class will take precedence over the active class if both are used simultaneously.  To avoid this issue, it's recommended that you try not to rely on style overrides across multiple classes.\",\"page\":\"How it works\",\"hash\":\"theming\"},{\"raw\":\"## Runtime\",\"level\":2,\"name\":\"Runtime\",\"breadcrumbs\":[\"How it works\",\"Runtime\"],\"content\":\"If you're not using themed styles, the runtime is not required.  The treat runtime is extremely lightweight, only needing to perform a simple lookup to figure out which pre-generated CSS class belongs to which theme.  The core API for performing this task is the resolveStyles function (or useStyles if you're using React).  Let's assume we have a treat file with some complex exports:    Because module exports are static, the treat runtime caches the resolved styles object in memory, which means that this cloning and class resolution process only happens once per treat file and theme, for the lifetime of your application.  It's important to note that this resolved styles object has the same type signature as the original styleRefs object, which means that themed styles remain type safe.\",\"page\":\"How it works\",\"hash\":\"runtime\"}]},{\"fileName\":\"setup.md\",\"id\":\"setup\",\"route\":\"/setup\",\"sections\":[{\"raw\":\"# Setup\",\"level\":1,\"name\":\"Setup\",\"breadcrumbs\":[\"Setup\"],\"content\":\"\",\"page\":\"Setup\",\"hash\":\"setup\"},{\"raw\":\"## Webpack Setup\",\"level\":2,\"name\":\"Webpack Setup\",\"breadcrumbs\":[\"Setup\",\"Webpack Setup\"],\"content\":\"  To get started, add the treat webpack plugin to webpack.config.js. Since webpack is required to use treat, the webpack plugin is provided via the core treat package as treat/webpack-plugin.    For more configuration options, view the full list of webpack options.\",\"page\":\"Setup\",\"hash\":\"webpack-setup\"},{\"raw\":\"## Babel Setup\",\"level\":2,\"name\":\"Babel Setup\",\"breadcrumbs\":[\"Setup\",\"Babel Setup\"],\"content\":\"  In order to improve the debugging experience, treat also provides an optional Babel plugin.  First, install the plugin:\",\"page\":\"Setup\",\"hash\":\"babel-setup\"},{\"raw\":\"## Debugging\",\"level\":2,\"name\":\"Debugging\",\"breadcrumbs\":[\"Setup\",\"Debugging\"],\"content\":\"Note: This can be automated via our Babel plugin.  All styling APIs (except for globalStyle) have an optional argument that allows you to provide a local debug name.  For example, the local name for the following style will be style by default because treat doesn't have access to your variable name at runtime.\",\"page\":\"Setup\",\"hash\":\"debugging\"},{\"raw\":\"## Server side rendering\",\"level\":2,\"name\":\"Server side rendering\",\"breadcrumbs\":[\"Setup\",\"Server side rendering\"],\"content\":\"  Server-rendered apps will likely be running two webpack builds (one for the browser code, and one for the server code). The server config should disable CSS output by setting outputCSS to false.\",\"page\":\"Setup\",\"hash\":\"server-side-rendering\"},{\"raw\":\"## Bundle splitting\",\"level\":2,\"name\":\"Bundle splitting\",\"breadcrumbs\":[\"Setup\",\"Bundle splitting\"],\"content\":\"  If you'd like to dynamically load themes, treat supports bundle splitting via webpack dynamic imports with no special setup.  In practice, it's likely you'll want to split your themes into separate CSS files. This is achieved by dynamic importing your treat files that call createTheme.  Let's assume you have a set of theme files that look like this:    If you're using the React API, you'll want to provide the theme to your TreatProvider.\",\"page\":\"Setup\",\"hash\":\"bundle-splitting\"}]},{\"fileName\":\"data-types.md\",\"id\":\"data-types\",\"route\":\"/data-types\",\"sections\":[{\"raw\":\"# Data Types\",\"level\":1,\"name\":\"Data Types\",\"breadcrumbs\":[\"Data Types\"],\"content\":\"  While not an exhaustive list of all types defined in the library, this section covers the core data types that are essential to using the library.\",\"page\":\"Data types\",\"hash\":\"data-types\"},{\"raw\":\"## Styles\",\"level\":2,\"name\":\"Styles\",\"breadcrumbs\":[\"Data Types\",\"Styles\"],\"content\":\"  Type: object  When passing styles to the style, styleMap and styleTree functions, or returning styles from a ThemedStyles function, you'll need to define them in the following format.\",\"page\":\"Data types\",\"hash\":\"styles\"},{\"raw\":\"## ThemedStyles\",\"level\":2,\"name\":\"ThemedStyles\",\"breadcrumbs\":[\"Data Types\",\"ThemedStyles\"],\"content\":\"  Type: function  Accepts a Theme and returns a Styles object.\",\"page\":\"Data types\",\"hash\":\"themedstyles\"},{\"raw\":\"## Theme\",\"level\":2,\"name\":\"Theme\",\"breadcrumbs\":[\"Data Types\",\"Theme\"],\"content\":\"  When defining themes and consuming themes, the provided theme object uses the Theme type, which is any by default. This means that any usage of a theme will not be type-safe.  The simplest way to fix this is to override this type at a global level. For example, you could create a treat.d.ts file in your project with the following contents.\",\"page\":\"Data types\",\"hash\":\"theme\"}]},{\"fileName\":\"styling-api.md\",\"id\":\"styling-api\",\"route\":\"/styling-api\",\"sections\":[{\"raw\":\"# Styling API\",\"level\":1,\"name\":\"Styling API\",\"breadcrumbs\":[\"Styling API\"],\"content\":\"  The following styling APIs are only valid within treat files (e.g. Button.treat.js).\",\"page\":\"Styling API\",\"hash\":\"styling-api\"},{\"raw\":\"## createTheme\",\"level\":2,\"name\":\"createTheme\",\"breadcrumbs\":[\"Styling API\",\"createTheme\"],\"content\":\"  Type: function  The createTheme function allows you to register individual themes within a treat file.\",\"page\":\"Styling API\",\"hash\":\"createtheme\"},{\"raw\":\"## style\",\"level\":2,\"name\":\"style\",\"breadcrumbs\":[\"Styling API\",\"style\"],\"content\":\"styleMap  Type: function  The styleMap function allows you to easily create multiple namespaces within a treat file.    ## style\",\"page\":\"Styling API\",\"hash\":\"style\"},{\"raw\":\"## styleMap\",\"level\":2,\"name\":\"styleMap\",\"breadcrumbs\":[\"Styling API\",\"styleMap\"],\"content\":\"  Type: function  The styleMap function allows you to easily create multiple namespaces within a treat file.\",\"page\":\"Styling API\",\"hash\":\"stylemap\"},{\"raw\":\"## styleTree\",\"level\":2,\"name\":\"styleTree\",\"breadcrumbs\":[\"Styling API\",\"styleTree\"],\"content\":\"  Type: function  > Note: This is an advanced feature that you probably don't need. It can only create themed styles. Only use this if you've exhausted all other options.  The styleTree function allows you to create complex, nested data structures based on your theme.  For example, if you wanted to create a nested atomic CSS structure (e.g. atoms.padding.top.desktop), which requires iterating over both your white space scale and your breakpoints, you could do the following:    > Note: When using styleTree, the babel-plugin does not add a local debug name for you, as it is too complex to infer in most cases. However, you can still manually pass a local debug name to the styleNode function you receive.\",\"page\":\"Styling API\",\"hash\":\"styletree\"},{\"raw\":\"## globalStyle\",\"level\":2,\"name\":\"globalStyle\",\"breadcrumbs\":[\"Styling API\",\"globalStyle\"],\"content\":\"  Type: function  The globalStyle function allows you to define selector-based styles. This function is purely a side effect and does not create a new class.\",\"page\":\"Styling API\",\"hash\":\"globalstyle\"}]},{\"fileName\":\"runtime-api.md\",\"id\":\"runtime-api\",\"route\":\"/runtime-api\",\"sections\":[{\"raw\":\"# Runtime API\",\"level\":1,\"name\":\"Runtime API\",\"breadcrumbs\":[\"Runtime API\"],\"content\":\"Note: If you're using React, you should use our React API instead.\",\"page\":\"Runtime API\",\"hash\":\"runtime-api\"},{\"raw\":\"## resolveStyles\",\"level\":2,\"name\":\"resolveStyles\",\"breadcrumbs\":[\"Runtime API\",\"resolveStyles\"],\"content\":\"  Type: function  Resolves styles for an entire treat file relative to a given theme.\",\"page\":\"Runtime API\",\"hash\":\"resolvestyles\"},{\"raw\":\"## resolveClassName\",\"level\":2,\"name\":\"resolveClassName\",\"breadcrumbs\":[\"Runtime API\",\"resolveClassName\"],\"content\":\"  Type: function  Resolves a single treat class name relative to a given theme.\",\"page\":\"Runtime API\",\"hash\":\"resolveclassname\"}]},{\"fileName\":\"react-api.md\",\"id\":\"react-api\",\"route\":\"/react-api\",\"sections\":[{\"raw\":\"# React API\",\"level\":1,\"name\":\"React API\",\"breadcrumbs\":[\"React API\"],\"content\":\"Note: React is not required to use treat.\",\"page\":\"React API\",\"hash\":\"react-api\"},{\"raw\":\"## TreatProvider\",\"level\":2,\"name\":\"TreatProvider\",\"breadcrumbs\":[\"React API\",\"TreatProvider\"],\"content\":\"  Type: Component  In order for the useStyles and useClassName Hooks to work, you'll need to render a TreatProvider higher in the tree.\",\"page\":\"React API\",\"hash\":\"treatprovider\"},{\"raw\":\"## useStyles\",\"level\":2,\"name\":\"useStyles\",\"breadcrumbs\":[\"React API\",\"useStyles\"],\"content\":\"  Type: function  A React Hook that resolves styles for an entire treat file relative to the current theme.\",\"page\":\"React API\",\"hash\":\"usestyles\"},{\"raw\":\"## useClassName\",\"level\":2,\"name\":\"useClassName\",\"breadcrumbs\":[\"React API\",\"useClassName\"],\"content\":\"  Type: function  A React Hook that resolves a single treat class relative to the current theme.\",\"page\":\"React API\",\"hash\":\"useclassname\"}]},{\"fileName\":\"webpack-options.md\",\"id\":\"webpack-options\",\"route\":\"/webpack-options\",\"sections\":[{\"raw\":\"# Webpack Options\",\"level\":1,\"name\":\"Webpack Options\",\"breadcrumbs\":[\"Webpack Options\"],\"content\":\"  The following options can be supplied to the included webpack plugin, e.g.    All configuration values are optional.  Some configuration defaults differ between production and development environments. This is inferred from your webpack mode setting.\",\"page\":\"Webpack Options\",\"hash\":\"webpack-options\"},{\"raw\":\"## outputLoaders\",\"level\":2,\"name\":\"outputLoaders\",\"breadcrumbs\":[\"Webpack Options\",\"outputLoaders\"],\"content\":\" Default: 'style-loader'] Type: [Array of webpack loader configurations  Defines which loaders generated CSS should be passed through after css-loader. Strings (e.g. style-loader) and objects with options are supported.\",\"page\":\"Webpack Options\",\"hash\":\"outputloaders\"},{\"raw\":\"## test\",\"level\":2,\"name\":\"test\",\"breadcrumbs\":[\"Webpack Options\",\"test\"],\"content\":\" Default: /\\\\.treat.(js\\\\|ts)$/ Type: Webpack condition  Configures which files are considered to be treat files.\",\"page\":\"Webpack Options\",\"hash\":\"test\"},{\"raw\":\"## localIdentName\",\"level\":2,\"name\":\"localIdentName\",\"breadcrumbs\":[\"Webpack Options\",\"localIdentName\"],\"content\":\" Default (Production): '[hash:base64:5]' Default (Development): '[name]-[local]\\\\[hash:base64:5]'_ Type: 'string'  Template string for naming CSS classes. Should always contain a hash option to avoid clashes.\",\"page\":\"Webpack Options\",\"hash\":\"localidentname\"},{\"raw\":\"## themeIdentName\",\"level\":2,\"name\":\"themeIdentName\",\"breadcrumbs\":[\"Webpack Options\",\"themeIdentName\"],\"content\":\" Default (Production): '[hash:base64:4]' Default (Development): '\\\\[name]-[local]\\\\[hash:base64:4]' Type: string  Same as localIdentName, but for themes. Useful for debugging which classes belong to which theme. Can also be a function that receives your theme, which is useful for minifying theme classes, e.g. theme => themeNames.indexOf(theme.name).\",\"page\":\"Webpack Options\",\"hash\":\"themeidentname\"},{\"raw\":\"## minify\",\"level\":2,\"name\":\"minify\",\"breadcrumbs\":[\"Webpack Options\",\"minify\"],\"content\":\" Default (Production): true Default (Development): false Type: boolean  Configures whether to minify the generated CSS.\",\"page\":\"Webpack Options\",\"hash\":\"minify\"},{\"raw\":\"## browsers\",\"level\":2,\"name\":\"browsers\",\"breadcrumbs\":[\"Webpack Options\",\"browsers\"],\"content\":\" Default: Browserslist config, if present. Type: Browserslist query  Configures which browsers to target when running generated CSS through autoprefixer.\",\"page\":\"Webpack Options\",\"hash\":\"browsers\"},{\"raw\":\"## outputCSS\",\"level\":2,\"name\":\"outputCSS\",\"breadcrumbs\":[\"Webpack Options\",\"outputCSS\"],\"content\":\" Default: true Type: boolean  Configures whether to output CSS in the resulting bundle. Useful for server rendered apps that have separate webpack builds for client and server code, only one of which needs to generate styles.\",\"page\":\"Webpack Options\",\"hash\":\"outputcss\"}]}];\n\n//# sourceURL=webpack://static/./site/docs-manifest.json?");

